import React from 'react'
import Formvoiture from './components/Formvoiture'
export default function App() {
  return (
    <div>
      <Formvoiture voitue={12333} marque=' fiat' ville={8}/>
      <Formvoiture voitue={22114} marque=' citiyen' ville={9}/>
      <Formvoiture voitue={77899} marque=' ffff' ville={10}/>
    </div>
  )
}
